class AzureFileRehash():
    def __init__(self):
        pass

    def _test(self):
        pass

    def _run(self, file_count):
        import hashlib
        from lsdb.models import AzureFile 

        hasher = hashlib.new('sha256')
        response_dict={}
        file_list=AzureFile.objects.filter(hash_algorithm='md5')[:int(file_count)]
        # return {'file_count':file_count}
        for tohash in file_list:
            # tohash = AzureFile.objects.get(id=file_id)
            oldhash=tohash.hash
            for buf in tohash.file.file.chunks(chunk_size = 65536):
                hasher.update(buf)
                tohash.hash_algorithm='sha256'
                tohash.hash=hasher.hexdigest()
                tohash.save()
            response_dict[str(tohash.id)]={"calculated":hasher.hexdigest(),
            "stored":oldhash}
        return response_dict

class SkipDCLChars():
    from django.db import IntegrityError, transaction
    """
    This plugin looks for the Execution Group named "Post Light Soak"
    To use this plugin:
    POST {
        "work_order_id":WORK_ORDER_ID
        }
    """
    # Not needed here?
    # def __init__(self):


    def _test(self:object):
        return(None)

    def _run(self:object, work_order_id:int=None):
    
        from lsdb.models import ProcedureResult
        from lsdb.models import WorkOrder
        from lsdb.models import Unit
        
        from django.core.exceptions import ObjectDoesNotExist
        
        try:
            work_order = WorkOrder.objects.get(id=work_order_id)
        except ObjectDoesNotExist:
            return {'Error':'Work Order ID {} does not exist'.format(self.work_order_id)}

        number_modified = 0
        for unit in work_order.units.all():
            for proc_result in unit.procedureresult_set.filter(name="Post-Light Soak", disposition__isnull=True):
                proc_result.allow_skip=True
                proc_result.save()
                number_modified += 1
        return "{} Procedure Results now skippable".format(number_modified)

class InsertMarker():
    from django.db import IntegrityError, transaction
    """
    Inserts a completed procedure result into any unit test plan 
    while blending in with the regular tests.
    To use this plugin:
    POST {
        "serial_number": "serial number in quotation marks",
        "leg_number": execution group number with no quotation marks
    }

    Example: {"serial_number":"001001","leg_number":2}
    """

    def _test(self:object):
        return(None)

    def _run(self:object, serial_number:str=None, leg_number:int=None):
    
        from django.utils import timezone
        
        from lsdb.models import ProcedureDefinition
        from lsdb.models import ProcedureResult
        from lsdb.models import Disposition
        from lsdb.models import Unit

        # Copy-pasted from ManageResultViewSet.py and modified for plugin use
        completed = Disposition.objects.get(name__iexact='completed')
        marker = ProcedureDefinition.objects.get(name__iexact='marker')

        try:
            unit = Unit.objects.get(serial_number=serial_number)
        except:
            return {'Error':"Unit with serial number {} does not exist".format(serial_number)}

        leg = unit.procedureresult_set.filter(linear_execution_group=leg_number).distinct().first()
        if leg:
            procedure_result = ProcedureResult.objects.create(
                unit = unit,
                name = leg.name,
                disposition = completed,
                group = marker.group,
                work_order = leg.work_order,
                procedure_definition = marker,
                version = marker.version,
                linear_execution_group = leg.linear_execution_group,
                test_sequence_definition = leg.test_sequence_definition,
                allow_skip = True,
                start_datetime = timezone.now(),
                end_datetime = timezone.now(),
            )
        else:
            return {'Error':"Execution Group {} not found".format(leg_number)}

        return "Marker set on {} at Execution Group {}".format(serial_number,leg_number)
